[include mainsail.cfg]
# For the ZNP Robin Nano DW v2.1 board:
#   - Compile with the processor model STM32F401.
#   - Select the 32KiB bootloader,
#   - Select (Serial (on # USART1 PA10/PA9) for the communication interface.
# Note that the "make flash" command does not work with ZNP Robin boards. After
# running "make", run the following command:
# cp out/klipper.bin out/ZNP_ROBIN_NANO.bin
# Copy the file out/ZNP_ROBIN_NANO.bin to an SD card and then restart the printer with
# that SD card.
# See docs/Config_Reference.md for a description of parameters.
# Klipper Backup test

[include shell_command.cfg]
[include mainsail.cfg]
[include macros.cfg]
[include timelapse.cfg]
[include adxl.cfg]
[include reshelper.cfg]
[include Eddy.cfg]
[include KAMP_Settings.cfg]

[exclude_object]

#[mcu host Pi4]
#serial: /tmp/klipper_host_mcu

[mcu]
serial: /dev/ttyAMA0
restart_method: command

[printer]
kinematics: cartesian
max_velocity: 800 #500
max_accel: 2000
max_z_velocity: 80 # - ANY HIGHER THAN 80 VELOCITY & 100 ACCEL RESULTS IN ERRATIC HOMING BEHAVIOUR!
max_z_accel: 100

[duplicate_pin_override]
pins: PC7, PC8, PC9, PC14

[stepper_x]
step_pin: !PC12
dir_pin: PB3
enable_pin: !PD2
microsteps: 16
rotation_distance: 40
endstop_pin: PA13
position_endstop: 0
position_max: 260 #250
homing_speed: 80 #100

[stepper_y]
step_pin: PC11
dir_pin: PA15
enable_pin: !PC10
microsteps: 16
rotation_distance: 40
endstop_pin: PB8
position_endstop: 0
position_max: 230
homing_speed: 80 #100

[stepper_z]
step_pin: PC7
dir_pin: !PC9
enable_pin: !PC8
rotation_distance: 8
microsteps: 16
endstop_pin: probe:z_virtual_endstop
position_min: -1.5 #0
position_max: 265
homing_speed: 10
second_homing_speed: 10
homing_retract_dist: 1.0

[manual_stepper z-max]
step_pin: PC7
dir_pin: !PC9
enable_pin: !PC8
rotation_distance: 8
microsteps: 16
endstop_pin: !PC14

[filament_switch_sensor z-max]
pause_on_runout: False
switch_pin: !PC14 

[gcode_macro BED_MESH_CALIBRATE]
rename_existing: BASE_BED_MESH_CALIBRATE
gcode:
  BED_MESH_CLEAR
  BASE_BED_MESH_CALIBRATE METHOD=rapid_scan

[extruder]
max_extrude_cross_section: 5
max_extrude_only_distance: 110.0
step_pin: PB10
dir_pin: PB1
enable_pin: !PC6
microsteps: 16
rotation_distance: 22.422 #22 #22.37
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: PA6
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PC1
min_temp: 0
max_temp: 300
pressure_advance: 0.075 
pressure_advance_smooth_time: 0.04 


[heater_bed]
heater_pin: PA5
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PC0
max_temp: 110
min_temp: 0

[heater_fan hotend_fan]
pin: PA7
heater: extruder
heater_temp: 50.0

[fan]
pin: PB0

[temperature_sensor 1_Raspberry_Pi_4b]
sensor_type: temperature_host

[temperature_sensor 2_Elegoo_Neptune_3]
sensor_type: temperature_mcu
sensor_temperature1: 25
sensor_adc1: 0.210317

[force_move]
enable_force_move: True

[gcode_macro TARE_PROBE]
gcode:
  {action_respond_info("Wait")}
  G4 P1000
  {action_respond_info("Start")}

[firmware_retraction]
retract_length: 4 #2
retract_speed: 200 #120
unretract_speed: 200 #120

[input_shaper]


[gcode_macro M420]
description: Load the current mesh
gcode:
  BED_MESH_PROFILE LOAD=default

[gcode_macro G29]
description: creates automated homing and bed mesh
gcode:
  G28
  BED_MESH_CALIBRATE METHOD=rapid_scan  ADAPTIVE=1
  BED_MESH_PROFILE SAVE=default

#           ************ START PRINT PROCEDURE ************

[gcode_macro START_PRINT] 
gcode: 
  #SET_PIN PIN=HeadLight VALUE=1
  BED_MESH_CLEAR
  M84
  G92
  {% set BED_TEMP = params.BED_TEMP|float %}
  {% set EXTRUDER_TEMP = params.EXTRUDER_TEMP|float %}    
  M104 S{EXTRUDER_TEMP}
  M190 S{BED_TEMP} 
  G90  
  G29 
  G92 E0
  M420
  G92 E0
  LINE_PURGE

